import { useState } from 'react';
import React from 'react';
import * as style from './styles';

export default function Matrix() {
  const [question, setQuestion] = useState('');
  const [answer, setAnswer] = useState('');
  const handleBlockClick = () => {};

  const blockGrid = Array.from(Array(3), () => new Array(3));
  let blockIndex = 0;

  for (let i = 0; i < 3; i++) {
    for (let j = 0; j < 3; j++) {
      blockGrid[i][j] = (
        <style.Squares
          key={blockIndex}
          onClick={() => handleBlockClick(blockIndex)}
          style={{
            width: '50px',
            height: '50px',
            backgroundColor: 'grey',
            margin: '5px',
            cursor: 'pointer',
          }}
        />
      );
      blockIndex++;
    }
  }
  return (
    <style.Container>
      <style.Squares>
        <style.SquareRow>
          <style.Square onClick={() => console.log(10)} />
          <style.Square />
          <style.Square />
        </style.SquareRow>
        <style.SquareRow>
          <style.Square />
          <style.Square />
          <style.Square />
        </style.SquareRow>
        <style.SquareRow>
          <style.Square />
          <style.Square />
          <style.Square />
        </style.SquareRow>
      </style.Squares>
    </style.Container>
  );
}
